import React, { useState, useEffect } from 'react';

function BookingHistory() {
  
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('https://myapi.com/bookings', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ date, time, duration, carType, location }),
      });
      const data = await response.json();
      setBookings([...bookings, data]);
    } catch (error) {
      console.error(error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await fetch(`https://myapi.com/bookings/${id}`, {
        method: 'DELETE',
      });
      setBookings(bookings.filter((booking) => booking.id !== id));
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <>
    <div>
      <h1>Booking History</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="date">Date:</label>
        <input type="date" id="date" value={date} onChange={(e) => setDate(e.target.value)} />

        <label htmlFor="time">Time:</label>
        <input type="time" id="time" value={time} onChange={(e) => setTime(e.target.value)} />

        <label htmlFor="duration">Duration:</label>
        <input type="text" id="duration" value={duration} onChange={(e) => setDuration(e.target.value)} />

        <label htmlFor="carType">Car Type:</label>
        <input type="text" id="carType" value={carType} onChange={(e) => setCarType(e.target.value)} />

        <label htmlFor="location">Location:</label>
        <input type="text" id="location" value={location} onChange={(e) => setLocation(e.target.value)} />

        <button type="submit">Book Parking</button>
      </form>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Time</th>
            <th>Duration</th>
            <th>Car Type</th>
            <th>Location</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((booking) => (
            <tr key={booking.id}>
              <td>{booking.date}</td>
              <td>{booking.time}</td>
              <td>{booking.duration}</td>
              <td>{booking.carType}</td>
              <td>{booking.location}</td>
              <td>
                <button onClick={() => handleDelete(booking.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
    </>
  )
}
export default BookingHistory
